import React, { useState } from "react";
import "../src/css/result.css";
import "../src/css/sr.css";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import Bsolo1r from "./Bsolo1r";
function Result() {
  const navigate=useNavigate();
  const [pd,spd] = useState([]);
  const bs1 = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "10:00 am",
    display: "flex",
  };
  const bs2 = {
    name: "BGMI",
    type: "SOLO",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "11:00 am",
    display: "flex",
  };
  const bsd = {
    name: "BGMI",
    type: "SQUAD",
    map: "ERANGLE",
    date: "01/01/2004",
    time: "12:00 am",
    display: "flex",
  };
  const fs1 = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "10:00 am",
    display: "flex",
  };
  const fs2 = {
    name: "FREE FIRE",
    type: "SOLO",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "11:00 am",
    display: "flex",
  };
  const fsd = {
    name: "FREE FIRE",
    type: "SQUAD",
    map: "BERMUDA",
    date: "01/01/2004",
    time: "12:00 am",
    display: "flex",
  };
  const bsolo1 =async()=>{
    await axios.get("http://localhost:4000/bs1r").then(d=>{spd(d.data.bsolo1)});
    navigate("/bsolo1r");
  };
  const bsolo2 = () => {};
  const bsquad = () => {};
  const fsolo1 = () => {};
  const fsolo2 = () => {};
  const fsquad = () => {};

  return (
    <div className="rmain">
      <div id="rn">RESULT OF THE MATCHES WILL BE CLEARED WITHIN 24HRS</div>
      <div className="rbody" style={{ display: `${bs1.display}` }}>
        <div className="gtmdt">GAME : {bs1.name}</div>
        <div className="gtmdt">TYPE : {bs1.type}</div>
        <div className="gtmdt">MAP : {bs1.map}</div>
        <div className="gtmdt">DATE : {bs1.date}</div>
        <div className="gtmdt">TIME : {bs1.time}</div>
        <button id="sr" onClick={bsolo1}>
          SHOW RESULT
        </button>
      </div>
      <div className="rbody" style={{ display: `${bs2.display}` }}>
        <div className="gtmdt">GAME : {bs2.name}</div>
        <div className="gtmdt">TYPE : {bs2.type}</div>
        <div className="gtmdt">MAP : {bs2.map}</div>
        <div className="gtmdt">DATE : {bs2.date}</div>
        <div className="gtmdt">TIME : {bs2.time}</div>
        <button id="sr" onClick={bsolo2}>
          SHOW RESULT
        </button>
      </div>
      <div className="rbody" style={{ display: `${bsd.display}` }}>
        <div className="gtmdt">GAME : {bsd.name}</div>
        <div className="gtmdt">TYPE : {bsd.type}</div>
        <div className="gtmdt">MAP : {bsd.map}</div>
        <div className="gtmdt">DATE : {bsd.date}</div>
        <div className="gtmdt">TIME : {bsd.time}</div>
        <button id="sr" onClick={bsquad}>
          SHOW RESULT
        </button>
      </div>
      <div className="rbody" style={{ display: `${fs1.display}` }}>
        <div className="gtmdt">GAME : {fs1.name}</div>
        <div className="gtmdt">TYPE : {fs1.type}</div>
        <div className="gtmdt">MAP : {fs1.map}</div>
        <div className="gtmdt">DATE : {fs1.date}</div>
        <div className="gtmdt">TIME : {fs1.time}</div>
        <button id="sr" onClick={fsolo1}>
          SHOW RESULT
        </button>
      </div>
      <div className="rbody" style={{ display: `${fs2.display}` }}>
        <div className="gtmdt">GAME : {fs2.name}</div>
        <div className="gtmdt">TYPE : {fs2.type}</div>
        <div className="gtmdt">MAP : {fs2.map}</div>
        <div className="gtmdt">DATE : {fs2.date}</div>
        <div className="gtmdt">TIME : {fs2.time}</div>
        <button id="sr" onClick={fsolo2}>
          SHOW RESULT
        </button>
      </div>
      <div className="rbody" style={{ display: `${fsd.display}` }}>
        <div className="gtmdt">GAME : {fsd.name}</div>
        <div className="gtmdt">TYPE : {fsd.type}</div>
        <div className="gtmdt">MAP : {fsd.map}</div>
        <div className="gtmdt">DATE : {fsd.date}</div>
        <div className="gtmdt">TIME : {fsd.time}</div>
        <button id="sr" onClick={fsquad}>
          SHOW RESULT
        </button>
      </div>
    <Bsolo1r data={pd}/>
    </div>
  );
}
export default Result;
